import api from "./axiosConfig";


export const getManagerByUserId = async (userId) => {
    const response = await api.get(`managers/by-user/${userId}`);
    return response.data;
};

export const getPropertiesByManagerId = async (managerId) => {
    const response = await api.get(`/properties/manager/${managerId}`);
    return response.data;
};
